import React from 'react';
import ReactDOM from 'react-dom/client';
// import App from './App';
import SimpleApp from './SimpleApp';  // Use the simpler version

const root = ReactDOM.createRoot(
  document.getElementById('root') as HTMLElement
);

root.render(
  <React.StrictMode>
    <SimpleApp />
  </React.StrictMode>
);
